  render() {
    return (
      <div className="App">
        <h1>Hi, I'm a React App</h1>
        <p>This is really working!</p>
        <Person name='Ryan' age='28'>My hobbies: wedding planning</Person>
        <Person name='Lucy' age='2'>My hobbies: eating </Person>
        <Person name='Rachael' age='23'/>
      </div>
    );
    // return React.createElement('div', {className: 'App'}, React.createElement('h1', null, 'Hi, I\'m a React App!'))
  }
}

export default App;
